		"text": "리틀 위치 아카데미아는 넷플릭스 오리지널 콘텐츠가 아니기 때문에 트리거는 독자적인 제작사로서 크라우드 펀딩을 받고, 넷플릭스에는 매절로 권리를 판 거죠. 매절로 돈을 얼마나 받았는지, 그게 기존 제작위원회보다 수익 면에서 얼마나 나은지 알 수 없지만",
