		"text": "저의 태도는 다소 모순적이라 생각될 수 있는데, 비평 역시도 2차창작적 폭력을 행사한다고 볼 수 있기 때문. 그러나 층위의 다름은 중요한 차이. 저 세계(이세계)를 바꾸는 문제와 이 세계(동세계)를 바꾸는 문제이기에. 이는 비평의 윤리.",
