		"text": "범죄자에게 금속활자로 낙인을 찍어 표식하는 것에서 유래한 것을 염두에 두고 보면 재밌는 문제예요. 한편 아즈마에겐 이러한 언어적 사고가 없었기에 '캐러'의 문제나 '고스트'의 문제에 닿지 못한 까닭이 되기도 한 거네요.",
