		"id": 850364573257351200,
		"id_str": "850364573257351168",
		"text": "(모에) 요소를 추출해낸 것은 흥미로운 점인데, 사실 음소와 같은 발상과 접근은 문자의 성립 이후에 비로소 가능한 것이거든요. 여하간 '신체', 또는 '문자'로서의 캐릭터는 Character가 문자라는 더 오래된 뜻 역시 갖고 있으며, 그 어원상",
		"truncated": false,
