		"text": "이야기가 나와서 말인데, 저는 캐릭터를 일종의 문자로 사고하고 있어요. 정확히는 오히려, 문자에 선행했던 것이 바로 캐릭터라고요. 음성언어는 소리에서 소리로 이어지며 그 형태가 고정되지 않고 음운변화를 겪으며 방언을 파생했죠. 문자 등장 이전까지는요.",
