		"id": 848911326382444500,
		"id_str": "848911326382444544",
		"text": "적당한 표현이 바로 떠오르지 않아서 시소타기라 표현했지만, 언어게임의 룰은 물론 계속 갱신되어 왔죠. 중심의 논점은 계속 변화해왔고. 평론이 이러한 언어게임을 넘어서지 않는 소박한 것이라면, 비평은 게임을 이루는 룰=언어를 갱신하고자 하는 작업이었어요",
