		"text": "이것은 비단 뉴아카 이래의 지난 40년뿐 아니라, 근대 문단의 탄생부터 이어져온 일종의 시소타기였어요. 자율성의 획득은 그 (시)장이 독자의 소비로 형성됨에 따라 가능했고, 논단은 어떤 논점=담론을 창출하고 주도하며 담론장 전반에 영향을 끼쳐왔죠.",
