		"text": "비평은 논단(의 자율성) 없이 성립할 수 없었고, 이 점은 매우 중요해요. \"분해-재조립\"은 특정한 맥락하에서 수행되는 재맥락화이고, 여기에서의 의미짓기(가치판단)는 논단의 그것이란 것. 일본 논단은 \"언어\" 게임을 벌이며 자율성을 획득해왔는데,",
